import React, { useState, useEffect } from "react";

const RiskProfileList = () => {
    // State to hold risk profiles
    const [riskProfiles, setRiskProfiles] = useState([]);
    const [currentPage, setCurrentPage] = useState(1);
    const profilesPerPage = 5;

    // Fetch risk profiles (Replace with actual API call)
    useEffect(() => {
        const fetchRiskProfiles = async () => {
            // Simulated API response
            const data = [
                { id: 1, profile_name: "Conservative", description: "Low risk tolerance", score_threshold: 70, tags: ["Stable", "Long-term"], active: true },
                { id: 2, profile_name: "Moderate", description: "Balanced risk approach", score_threshold: 80, tags: ["Growth", "Income"], active: true },
                { id: 3, profile_name: "Aggressive", description: "High-risk investments", score_threshold: 90, tags: ["Stocks", "Crypto"], active: false },
                { id: 4, profile_name: "Speculative", description: "Very high risk", score_threshold: 95, tags: ["Options", "Forex"], active: false },
                { id: 5, profile_name: "Retirement", description: "Long-term security", score_threshold: 75, tags: ["Pension", "Bonds"], active: true }
            ];
            setRiskProfiles(data);
        };
        fetchRiskProfiles();
    }, []);

    // Pagination logic
    const indexOfLastProfile = currentPage * profilesPerPage;
    const indexOfFirstProfile = indexOfLastProfile - profilesPerPage;
    const currentProfiles = riskProfiles.slice(indexOfFirstProfile, indexOfLastProfile);

    const nextPage = () => {
        if (currentPage < Math.ceil(riskProfiles.length / profilesPerPage)) {
            setCurrentPage(currentPage + 1);
        }
    };

    const prevPage = () => {
        if (currentPage > 1) {
            setCurrentPage(currentPage - 1);
        }
    };

    // Edit & Disable handlers (Placeholder functions)
    const editProfile = (id) => {
        console.log("Edit Profile ID:", id);
    };

    const toggleProfileStatus = (id) => {
        setRiskProfiles(riskProfiles.map(profile => 
            profile.id === id ? { ...profile, active: !profile.active } : profile
        ));
    };

    return (
        <div className="grid-item span-2">
            <h2>Risk Profiles</h2>
            <div className="table-container">
                <table>
                    <thead>
                        <tr>

                            <th>Profile Name</th>
                            <th>Description</th>
                            <th>Score Threshold</th>
                            <th>Tags</th>
                            <th>Status</th>
                            <th>Actions</th>
                        </tr>
                    </thead>
                    <tbody>
                        {currentProfiles.map(profile => (
                            <tr key={profile.id}>

                                <td>{profile.profile_name}</td>
                                <td>{profile.description}</td>
                                <td>{profile.score_threshold}%</td>
                                <td>{profile.tags.join(", ")}</td>
                                <td>{profile.active ? "Active" : "Inactive"}</td>
                                <td>
                                    <button className="button-link" onClick={() => editProfile(profile.id)}>✏️</button>
                                    <button className="button-link" onClick={() => toggleProfileStatus(profile.id)}>
                                        {profile.active ? "❌" : "✅"}
                                    </button>
                                </td>
                            </tr>
                        ))}
                    </tbody>
                </table>
            </div>

            {/* Pagination */}
            <div className="pagination">
                <button className="button-link" onClick={prevPage} disabled={currentPage === 1}>Prev</button>
                <span className="page-info"> {currentPage} of {Math.ceil(riskProfiles.length / profilesPerPage)} </span>
                <button className="button-link" onClick={nextPage} disabled={currentPage === Math.ceil(riskProfiles.length / profilesPerPage)}>Next</button>
            </div>

            {/* Add Risk Profile Link */}
            <a href="#" className="add-user-link">Add Risk Profile</a>
        </div>
    );
};

export default RiskProfileList;
